const Navigation = () => {
  return (
    <div>
      <aside className="aside">
        <h3>Kategorier</h3>
        <nav className="nav">
          <ul>
            <li>
              <a href="">Kategori 1</a>
            </li>
            <li>
              <a href="">Kategori 2</a>
            </li>
            <li>
              <a href="">Kategori 3</a>
            </li>
          </ul>
        </nav>
      </aside>
    </div>
  );
};

export default Navigation;
